import React from 'react'
import FeedItem from './feedItem'
import NavigationItem from '../../navigationItem/navigationItem'

let style = {
    overflow: 'scroll',
    height: '350px'
}

let feedList = []

setInterval(() => {
    feedList.push(<NavigationItem>ABCDEF</NavigationItem>)
    console.log(feedList)
}, 3000)


const unregisteredFeed = () => {
    return(
    <div style={style}>
        <h1>Unregistered Activity</h1>
        {feedList}
    </div>)
}


export default unregisteredFeed
